import React, { useEffect } from 'react';
import ee from '@google/earthengine';

function App() {
  useEffect(() => {
    ee.initialize();

    ee.Authenticate().then(() => {
      const map = new ee.Map();
      map.setCenter(-122.439, 37.7595, 10);

      const collection = ee.ImageCollection('LANDSAT/LC08/C01/T1_TOA')
        .filterDate('2016-01-01', '2016-12-31')
        .filterBounds(ee.Geometry.Rectangle(-122.496, 37.735, -122.356, 37.824))
        .select(['B5', 'B4'])
        .map((image) => image.normalizedDifference(['B5', 'B4']));

      const visParams = { min: 0, max: 1, palette: ['000000', '00FF00'] };

      map.addLayer(collection.mean(), visParams, 'NDVI');
      map.addLayer(ee.FeatureCollection('TIGER/2018/States'), {}, 'US States');

      map.setControlVisibility({ fullscreenControl: true });
      map.setOptions('SATELLITE');

      map.addTo('map');
    });
  }, []);

  return <div id="map" style={{ height: '100vh', width: '100%' }} />;
}

export default App;
